const results = [];

// Loop through all input items
for (let i = 0; i < items.length; i++) {
    // Get the date from the current item (assuming the input is in the field 'date')
    const inputDate = items[i].json.body.connected_date_time;

    // Check if the input date is valid
    if (!inputDate || isNaN(new Date(inputDate).getTime())) {
        results.push({
            json: {
                error: 'Invalid date input',
                originalDate: inputDate
            }
        });
        continue; // Skip to the next item if the date is invalid
    }

    const date = new Date(inputDate);

    // Adjusting for the timezone offset (+5:30)
    const timezoneOffset = 5.5 * 60 * 60 * 1000;
    const adjustedDate = new Date(date.getTime() + timezoneOffset);

    const isoString = adjustedDate.toISOString();

    // Remove the 'Z' at the end of the ISO string (UTC indicator)
    const withoutZ = isoString.replace('Z', '');

    // Add the timezone information (+05:30)
    const formattedDate = withoutZ + '+05:30';

    // Add the formatted date to the result for this item
    results.push({
        json: {
            formattedDate
        }
    });
}

// Return the results in the expected format
return results;

const items = $input.all();  // Fetch all input items
const results = [];

for (let i = 0; i < items.length; i++) {
    let number = items[i].json.body.phone;  // Assuming the input number is under 'phoneNumber' key

    // Check if number is defined and is a valid string or number
    if (!number) {
        results.push({
            json: {
                normalizedPhoneNumber: 'Invalid number format'
            }
        });
        continue;  // Skip to the next iteration
    }

    // Remove all non-digit characters
    let cleanNumber = number.toString().replace(/[^\d]/g, '');

    let normalizedNumber;

    // If the number starts with '91' and is 12 digits long, remove the first two digits
    if (cleanNumber.startsWith('91') && cleanNumber.length === 12) {
        normalizedNumber = cleanNumber.slice(2);
    } 
    // If the number is already 10 digits, use it as is
    else if (cleanNumber.length === 10) {
        normalizedNumber = cleanNumber;
    } 
    // If the number starts with '+91' and is 13 digits long, remove the first three digits
    else if (cleanNumber.startsWith('91') && cleanNumber.length === 13) {
        normalizedNumber = cleanNumber.slice(3);
    } else {
        normalizedNumber = 'Invalid number format';
    }

    results.push({
        json: {
            normalizedPhoneNumber: normalizedNumber
        }
    });
}

return results;

